import React from 'react';
import '../progressbars/progressbars.scss';
import { CircularProgressbar } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';

export default function Progressbars () {
    let value = 200;
    let minval = 0;
    let maxVal = 200;
    return (
        <>
            <div className='progressbars__container'>
                <CircularProgressbar
                className="chart"
                value = {value}
                minValue = {minval}
                maxValue = {maxVal}
                text = {`${value}item` }
                 />
                <span>PTW opened</span>

                <CircularProgressbar
                className="chart"
                value = {value}
                minValue = {minval}
                maxValue = {maxVal}
                text = {`${value}item` }
                 />
                <span>PTW opened</span>
            </div>
        </>
    )
}
